// src/pages/LandingPage.js
import React from 'react';
import { Link } from 'react-router-dom';

export default function LandingPage() {
  return (
    <div
      className="d-flex flex-column justify-content-center align-items-center vh-100 text-center px-3"
      style={{ backgroundColor: 'var(--color-dark-blue)', color: 'var(--color-off-white)' }}
    >
      <h1 className="display-3 mb-3">LivingLink</h1>
      <p className="lead mb-4" style={{ maxWidth: 600 }}>
        Your residential society management made easy. Stay connected, pay fees,
        book facilities, submit complaints anonymously, track finances, and more.
      </p>
      <div>
        <Link to="/login" className="btn btn-primary btn-lg me-3">
          Login
        </Link>
        <Link to="/register" className="btn btn-outline-light btn-lg">
          Register
        </Link>
      </div>
    </div>
  );
}
